# putting each pet's data into the database
@AvaiblePets.each do |pet|
  Store.create(status: "Available",
  name: pet["name"],
  gender: pet["sex"],
  organisationid: pet["orgID"].to_i,
  age: rand(1..3),
  breed: pet["primaryBreed"],
  locationzip: pet["locationZipcode"].to_i,
  image: pet["pic1"] )
end

